import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">Carbonyte Project</header>
      <div>
        <div className="row">
          <div className="column">My Helper Contract</div>
          <div className="vl"></div>
          <div className="column">Your Arbitrum Contract</div>
        </div>
      </div>
    </div>
  );
}

export default App;
